          <p className="row-[4/_5] col-[4_/_5] text-[2rem] text-black font-thin">2022年，Wei等人正式提出
            “<span className="bg-[#3CD6A3]">思维链</span>”（Chain-of-Thought, CoT）概念，将其定义为一种通过显式生成中间推理步骤来提升模型复杂问题解决能力的方法。
            此后，在思维链的基础上，许多学者又提出了许多思维链的衍生方法，如“<span className="bg-[#EBFF52]">思维树</span>”（Tree of Thoughts），
            “<span className="bg-[#F7A1DB]">思维图</span>”（Graph of Thoughts）等，这些扩展不仅提升了AI的准确性，也为跨领域问题的处理提供了通用框架。</p>
